const baseUrl = 'http://api.themoviedb.org/3';
export class ConstantUri {
  public static readonly apikey = '95bbcb7441478e733370d429c0d33eb5 ';
  public static readonly validateWitheLogin = baseUrl + '/authentication/token/validate_with_login';
  public static readonly tokenNew = baseUrl + '/authentication/token/new'
}
